import React from 'react';
import * as ReactBootStrap from "react-bootstrap";

import {  Link } from "react-router-dom";
const navbar= () =>{
    return (
        <div>
            <li>
                <Link to="/">Dogs</Link>
            </li>
            <li>
                <Link to="/about">Cats</Link>
            </li>
            <li>
                <Link to="/blogs">Sheeps</Link>
            </li>
            <li>
                <Link to="/contact">Goats</Link>
            </li>
        </div>
    );
}
export default navbar;
